import './App.css';
import Header from './layout/js/Header';
import Body from './layout/js/Body'
import {useRef, useState} from "react";

function App() {
    const filter = useRef([]);

    return (
        <div className="App">
            <Header filter={filter}/>
            <Body filter={filter}/>
        </div>
    );
}

export default App;
